import React, { useEffect } from 'react';
import axios from 'axios'

const ChatPage = () => {
  const fetchChats = async () => {
    const data = await axios({method: 'post', url: 'api/user/login', headers: {}, data: {email: "test", password: "password"}});

    console.log(data);
  }

  useEffect(() => {
    fetchChats();
  },[]);

  return (
    <div>
      Chat
    </div>
  );
};

export default ChatPage;
